            try
            {
                var r = Channel.LoadEntityHierarchyRecurs(cntx, entity.ShallowCopy(), uplev, lowlev);
                if (r != null)
                    setupTreeNode(r);
                return r;
            }
            catch (Exception ex)
            {
                HandleError(ex);
                return null;
