        private void setupTreeNode(EntityAbs<Role> n)
        {
            n.DataBehind.StartAutoUpdating = true;
            if (n.ChildEntities != null && n.ChildEntities.Count > 0)
            {
                foreach (var c in n.ChildEntities)
                    setupTreeNode(c);
            }
        }

